import json
import datetime
import looker_sdk
import os
from urllib.parse import urlparse

def rHandle(s, b):
  return json.dumps({
    "statusCode": s,
    "body": {
      "message": b
    }
  })

def action_list(request):
	r = request.get_json()
	print(r) # so it shows up in logs
    
	response = """
        {
       	"integrations": [{
       		"name": "cisconextbestaction",
          "label": "Cisco: NBA",
       		"description": "Retrieve the next best action for the user",
       		"supported_action_types": ["query","dashboard"],
       		"url": "https://us-central1-graphic-theory-197904.cloudfunctions.net/execute_nba",
       		"form_url": "",
          "icon_data_uri": "data:image/png;base64,",
        	"required_fields": [],
       		"params": [],
          "supported_formats": ["json_detail","csv_zip"],
          "supported_formattings": ["unformatted"],
          "supported_visualization_formattings": ["noapply"]
       	}]
       }
	"""
	return response


def execute_nba(r):

  if r.path == '/action_list':
    return action_list(r)

  headers = r.headers
  current_time = datetime.datetime.now()
  request_json = r.json

  sdk = looker_sdk.init31() 
  query = sdk.query_for_slug(request_json['scheduled_plan']['query']['client_id'])
  sql = sdk.run_query(query.id, 'sql', 22).replace('LIMIT 22','')
  new_sql = "SELECT data.ts, users.*, data.id, uniform(1, 10, random()) as next_best_action FROM (%s) as users CROSS JOIN (SELECT '%s'::timestamp as ts, '%s' as id) as data" % (sql, str(current_time), headers['x-looker-webhook-id'])
  insert_sql = "INSERT INTO ${%s.SQL_TABLE_NAME} %s" % (os.environ['LOOKML_VIEW_NAME'], new_sql)
  sql_query = sdk.create_sql_query(body=looker_sdk.models.SqlQueryCreate(model_name=os.environ['LOOKML_MODEL_NAME'], sql=insert_sql))
  sdk.run_sql_query(sql_query.slug, 'json')

  return rHandle(200,"ok")